import { MDBDataTable } from 'mdbreact';
const SearchTable = () => {
    const [data, setData] = useState([]);

  // using axios to get Data
  const getData = () => {
     axios.get("http://localhost:3002/show")
          .then((res)=> {
            console.log(res);
            setData(res.data);
          });
        }
useEffect(() => {
  getData();
}, [])

   const columns= [
        {
          label: 'Full Name',
          field: 'fullname',

        }, {
            label: 'Email',
            field: 'email',

          },
          {
            label: 'Role',
            field: 'role',

          },
    ]

    return (
        <div>
             <MDBDataTable  
      data={this.state.users}  
      columns={columns}  
   />
        </div>
    )
}

export default SearchTable
